import styles from "./UserList.module.css";
const UserList = (props) => {
  const deleteHandler = () => {
    props.onDelete(item.id);
  };
  return (
    <div className={styles.users}>
      <ul>
        {props.items.map((item) => (
          <li
            onClick={deleteHandler}
            key={item.id}
          >{`${item.username} : ${item.age}`}</li>
        ))}
      </ul>
    </div>
  );
};
export default UserList;
